import "./App.css";
import "./index.css";
import Moscu from "./Images/moscu.jpg";

function App() {
  return (
    <div className="App">
      <img
        className="w-12/12 h-screen align-center justify-center"
        src={Moscu}
        alt="moscu"
      />
    </div>
  );
}

export default App;
